import "./contact.css";
const Contact=()=>{
    return(
        <section className="contact">
          <div className="contact-wrapper">
             <div className="contact-item">
                 <div className="contact-item-icon">
                    
                 </div>
             </div>
          </div>
        </section>
    );
    }
    
    export default Contact;
